import React from 'react';
import logo from './logo.svg';
import './App.css';

class Nav extends React.Component {
  render() {
    return (
      <nav className="row">
        <i className="fa fa-home col-sm-1"></i>
        <a href="/">caCompilePas</a>
      </nav>
    )
  }
}


class Lobby extends React.Component {
  render() {
    return (
      <div>
      </div>
    )
  }
}

function App() {
  return (
    <div className="App container-fluid">
      <Nav />
      <h1>Nom du lobby</h1>
      <Lobby />
    </div>
  );
}

